import React, { Component } from 'react';
import './Navbar.css'
import Logo from './images/logo.png';

class Navbar extends Component{
    render() {
      return (
          <div className="Navbar">
              <img src={Logo} alt="Logo" />
              <div className="Navbar__Port">
                  <ul>
                      <li>
                        <a href="/">Portafolio</a>
                      </li>
                  </ul>
              </div>
          </div>
      )
    }
}

export default Navbar;
